webpackJsonp([0xce667d502106],{344:function(A,a){A.exports={data:{markdownRemark:{html:'<p><strong><em>Hailu Mergia</em></strong><br>\n<em>Lalu Belu</em>\nJaunty Ethio-jazz with a rotating cast of lead voices - piano, organ, synth, and accordion get alternating, sometimes overlapping, takes at steering the close-knit, raucous rhythm section. The party concludes abruptly with a stumbling ballad on solo piano that winds the album to a bummer conclusion.<br>\n<a\n    class="gatsby-resp-image-link"\n    href="/records-i-bought/static/hailu-mergia-d1d809209a79635ef7333a1297c364f8-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Hailu Mergia - Lalu Belu"\n        title=""\n        src="/records-i-bought/static/hailu-mergia-d1d809209a79635ef7333a1297c364f8-8e2e9.jpg"\n        srcset="/records-i-bought/static/hailu-mergia-d1d809209a79635ef7333a1297c364f8-dd96d.jpg 148w,\n/records-i-bought/static/hailu-mergia-d1d809209a79635ef7333a1297c364f8-eaf39.jpg 295w,\n/records-i-bought/static/hailu-mergia-d1d809209a79635ef7333a1297c364f8-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Toddy Terry</em></strong><br>\n<em>Remixes</em>\nNothing more or less than a mix of alt-Jock Jams, a deviation that seeks heart before ass, or at least regards them as equivalent partners on the dance floor. His emphatic hi-hats and midrange bass tend to confine his palette from the remotely soulful. The dominant value here is his skill at rearrangment, restructuring pop songs into house music narratives.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/records-i-bought/static/todd-terry-272f018d5dd106f8fd900a6f2685dfe7-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 98%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Todd Terry - Remixes"\n        title=""\n        src="/records-i-bought/static/todd-terry-272f018d5dd106f8fd900a6f2685dfe7-8e2e9.jpg"\n        srcset="/records-i-bought/static/todd-terry-272f018d5dd106f8fd900a6f2685dfe7-dd96d.jpg 148w,\n/records-i-bought/static/todd-terry-272f018d5dd106f8fd900a6f2685dfe7-eaf39.jpg 295w,\n/records-i-bought/static/todd-terry-272f018d5dd106f8fd900a6f2685dfe7-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><strong><em>Bella Boo</em></strong><br>\n<em>Fire</em>\nWOw! Beatific and dazed house music mostly, with some downtempo stirred in, craftily tacked together from upcycled samples and light-footed drum programming. Handcrafted for those deep feels, like if Etsy had a record label.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/records-i-bought/static/bella-boo-1f0774b53d8a550a5e93671328fcb79a-8e2e9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top:10px;; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Bella Boo - Fire"\n        title=""\n        src="/records-i-bought/static/bella-boo-1f0774b53d8a550a5e93671328fcb79a-8e2e9.jpg"\n        srcset="/records-i-bought/static/bella-boo-1f0774b53d8a550a5e93671328fcb79a-dd96d.jpg 148w,\n/records-i-bought/static/bella-boo-1f0774b53d8a550a5e93671328fcb79a-eaf39.jpg 295w,\n/records-i-bought/static/bella-boo-1f0774b53d8a550a5e93671328fcb79a-8e2e9.jpg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{date:"May 16, 2018",path:"/mid-may",title:"Hailu Mergia, Todd Terry, Bella Boo"}}},pathContext:{}}}});
